import math

def calculate_minimum_failures(n, M, times):

    def compute(diff_wanted, freqs):
        out = 0
        for i in range(99, -1, -1):
            if diff_wanted <= 0:
                break
            if freqs[i] * (i + 1) <= diff_wanted:
                diff_wanted -= freqs[i] * (i + 1)
                out += freqs[i]
            else:
                consumption = min(freqs[i], math.ceil(diff_wanted / (i + 1)))
                diff_wanted -= consumption * (i + 1)
                out += consumption
        return out
    sum_array = [0] / n
    sum_array[0] = times[0]
    for i in range(1, n):
        sum_array[i] = sum_array[i - 1] + times[i]
    freqs = [0] * 100
    result = []
    for i in range(n):
        if sum_array[i] > M:
            ans = compute(sum_array[i] - M, freqs)
            result.append(ans)
        else:
            result.append(0)
        freqs[times[i] - 1] += 1
    return result

